import React, { useState } from "react";
import {
  Card,
  CardMedia,
  CardContent,
  CardActions,
  Typography,
  Button,
  IconButton,
  Box,
  Rating,
  Chip
} from "@mui/material";
import {
  AddShoppingCart as AddShoppingCartIcon,
  Favorite as FavoriteIcon,
  FavoriteBorder as FavoriteBorderIcon
} from "@mui/icons-material";
import { styled } from "@mui/material/styles";

const StyledCard = styled(Card)(({ theme }) => ({
  height: "100%",
  display: "flex",
  flexDirection: "column",
  borderRadius: 12,
  boxShadow: "0 4px 20px rgba(0,0,0,0.06)",
  transition: "transform 0.25s ease, box-shadow 0.25s ease",
  "&:hover": {
    transform: "translateY(-4px)",
    boxShadow: "0 10px 30px rgba(0,0,0,0.12)",
  },
}));

const MenuCard = ({ item, addToCart }) => {
  const [fav, setFav] = useState(false);

  const handleAdd = (e) => {
    e.stopPropagation();
    addToCart(item);
  };

  return (
    <StyledCard>
      <Box sx={{ position: "relative" }}>
        <CardMedia
          component="img"
          height="180"
          image={item.image || "https://source.unsplash.com/random/600x400/?food"}
          alt={item.name}
          sx={{ objectFit: "cover" }}
        />
        <IconButton
          onClick={(e) => { e.stopPropagation(); setFav(!fav); }}
          sx={{
            position: "absolute",
            top: 8,
            right: 8,
            bgcolor: "rgba(255,255,255,0.95)",
            "&:hover": { bgcolor: "white" }
          }}
          aria-label="favorite"
        >
          {fav ? <FavoriteIcon color="error" /> : <FavoriteBorderIcon />}
        </IconButton>
        {item.isPopular && (
          <Chip
            label="Popular"
            color="primary"
            size="small"
            sx={{ position: "absolute", top: 8, left: 8, fontWeight: 700 }}
          />
        )}
      </Box>

      <CardContent sx={{ flexGrow: 1, p: 2 }}>
        <Box sx={{ display: "flex", justifyContent: "space-between", mb: 1 }}>
          <Typography variant="subtitle1" fontWeight={700} noWrap>
            {item.name}
          </Typography>
          <Typography variant="subtitle1" color="primary" fontWeight={700}>
            â‚¹{Number(item.price).toFixed(2)}
          </Typography>
        </Box>

        {item.description && (
          <Typography
            variant="body2"
            color="text.secondary"
            sx={{
              mb: 1,
              overflow: "hidden",
              textOverflow: "ellipsis",
              display: "-webkit-box",
              WebkitLineClamp: 2,
              WebkitBoxOrient: "vertical",
              minHeight: "2.8em"
            }}
          >
            {item.description}
          </Typography>
        )}

        <Box sx={{ display: "flex", alignItems: "center", mb: 1 }}>
          <Rating value={item.rating || 4.5} precision={0.5} readOnly size="small" />
          <Typography variant="body2" color="text.secondary" sx={{ ml: 1 }}>
            ({item.reviewCount || 24})
          </Typography>
        </Box>

        {item.category && (
          <Chip label={item.category} size="small" variant="outlined" />
        )}
      </CardContent>

      <CardActions sx={{ p: 2, pt: 0 }}>
        <Button
          fullWidth
          variant="contained"
          startIcon={<AddShoppingCartIcon />}
          onClick={handleAdd}
          sx={{ borderRadius: 2, textTransform: "none", fontWeight: 700 }}
        >
          Add to Cart
        </Button>
      </CardActions>
    </StyledCard>
  );
};

export default MenuCard;
